import React from "react";
import { createComponent } from "react-fela";

const blockContainer = () => ({
  width: "100%",
  textAlign: "center",
  display: "flex",
  flexWrap: "wrap"
});

const BlockContainer = createComponent(blockContainer, "div");

export default BlockContainer;
